import Head from "next/head";
import Layout from "../component/Layout";
import fetch from "isomorphic-fetch";

class Favorite extends React.Component {
  constructor(props) {
    super(props);
  }

  async callAPI() {
    const favoriteItem = await fetch("http://localhost:9000/favorite");
    const res = await favoriteItem.json();

    if (typeof this.props.handleLikedItemList === "function") {
      this.props.handleLikedItemList(res);
    }
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {
    return (
      <Layout>
        <div>
          <Head>
            <title>Favorites</title>
          </Head>
        </div>
      </Layout>
    );
  }
}

export default Favorite;
